snippet.description:
Der Mythos Ötztaler. Jedes Jahr haben rund 4.000 Rennradfahrer einen Traum: den anspruchsvollsten Radmarathon der Alpen zu finishen. Der Weg dorthin ist steinig -  das Ziel zu erreichen ist der Traum aller Teilnehmer. Ein kleiner Rückblick auf den diesjährigen Ötztaler Radmarathon 2022 umso schöner. 
 
